import React from 'react';
import { useNavigate } from 'react-router-dom'; // Import useNavigate for navigation

const FinalPage = () => {
    const navigate = useNavigate();

    const handleReportGenerator = () => {
        // Logic for report generation can be added here
        console.log("Report generated!");
        // For example, navigate to the report generation page
        navigate('/report'); // Change '/report' to your actual report route
    };

    const handleReturnHomepage = () => {
        navigate('/'); // Navigate to the homepage
    };

    return (
        <div className="container mt-5">
            <h1 className="mb-4">Final Review</h1>

            {/* Section 1 */}
            <div className="mb-4">
                <h2>Section 1</h2>
                <p>
                    This is the first section of the final page. Here, you can provide
                    an overview of the process, summarize key points, or include any
                    important information related to the completed steps.
                </p>
            </div>

            {/* Section 2 */}
            <div className="mb-4">
                <h2>Section 2</h2>
                <p>
                    In the second section, you can elaborate on specific details,
                    provide additional instructions, or present any relevant data that
                    supports the user's journey through the application.
                </p>
            </div>

            {/* Section 3 */}
            <div className="mb-4">
                <h2>Section 3</h2>
                <p>
                    The final section is a conclusion or a summary of the entire
                    process. You might want to encourage the user to reach out for
                    further assistance or highlight next steps they can take.
                </p>
            </div>

            {/* Buttons */}
            <div className="d-flex justify-content-between">
                <button
                    className="btn btn-primary"
                    onClick={handleReportGenerator}
                >
                    Report Generator
                </button>
                <button
                    className="btn btn-secondary"
                    onClick={handleReturnHomepage}
                >
                    Return Homepage
                </button>
            </div>
        </div>
    );
};

export default FinalPage;
